import Card from '../Card/Card';

export default function Cards(props) {
   const { characters } = props;
   let i = 0
   return <div>
      {characters.map((element) => (
         <Card 
         name={element.name}
         species={element.species}
         gender={element.gender}
         image={element.image}
         onClose={() => props.onClose(element.id)}
         key={i++}
      />
      ))}
   </div>;
}
